import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav style={{ padding: '1rem', background: '#e0ffe0' }}>
      <Link to="/clubs" style={{ marginRight: '1rem' }}>Clubs</Link>
    </nav>
  );
}

export default Navbar;
